import React from 'react';
import { useTranslation} from 'react-i18next';
import '../styles/App.scss';
import '../styles/Classes.scss';
import GalleryClasses from '../components/GalleryClasses';

function Classes() {
    
    const { t } = useTranslation();
    return (
        <>
             <div className="containerClasses">
                <div className="titleClasses">
                    <h1>{t('classes.titlePage')}</h1>
                    <h4>{t('classes.introPage')}</h4>
                </div>
                <GalleryClasses/>
               <div className="placesClassesSection">
                   <h4>{t('classes.info')}</h4>
                   <div className="placesClasses">
                        <p>AGUASCALIENTES</p>
                        <p>GAUDALAJARA</p>
                        <p>SALTILLO</p>
                   </div>
                   <h4>{t('classes.info1')}</h4>
               </div>
               <div className="joinClasses">
                    <h1>{t('classes.joinTitle')}</h1>
                    <h4>{t('classes.joinText')}</h4>
                    <p>{t('classes.contact')}</p>
               </div>
             </div>
        </>
    )
}

export default Classes;
